import React from "react";
import PanelTemplate from "./PanelTemplate";

function Reports() {
    return (
        <PanelTemplate
            title="Reports"
            rightContent={
                <h2>Welcome to the Reports Panel</h2>
            }
        />
    );
}

export default Reports;
